import React from 'react'
import {HomeOutlined, GridOffOutlined, ShareOutlined, BarChart, AccountBoxOutlined, DynamicFeedOutlined, FileCopyOutlined} from '@material-ui/icons'


const dataMenu = [{
        title : 'Home',
        icon : HomeOutlined
    },{
        title : 'Browse',
        icon : GridOffOutlined
    },{
        title : 'Category',
        icon : ShareOutlined
    },{
        title : 'Trending',
        icon : BarChart
    },{
        title : 'Profile',
        icon : AccountBoxOutlined
    },{
        title : 'Recently Played',
        icon : DynamicFeedOutlined
    },{
        title : 'Recently Played',
        icon : FileCopyOutlined
    }
]
const Menu = () => {
  return (
    <div className="container-menu">
      <div className="logo">
          MOVIE
      </div>
      <div className="menu">
          {/* {
              dataMenu.map((item) => (
                <div className="itemMenu">
                    {item.icon}
                    <p className="titleMenu">{item.title}</p>
                </div>
              ))
          } */}
          <div className="itemMenu">
            {dataMenu[0].icon}
            <p className="titleMenu">Home</p>
        </div>
      </div>
      <style jsx>{`
        .container-menu {
            flex: 1;
            justifyContent: center;
            alignItems: center;
        }
        .logo {
            margin-bottom:25px;
            font-weight:bold,
            font-size:20px
        }
        .itemMenu {
            display:flex;
            flexDirection:row;
            justifyContent:space-between;
            margin-bottom : 15px;
        }
      `}</style>
    </div>
  )
}

Menu.propTypes = {

}

export default Menu
